import React from 'react';

class SearchFriends extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                <input
                    type="text"
                    className="form-control"
                    placeholder="Search friends"
                />
            </div>
        );
    }
}

export default SearchFriends;
